// ==UserScript==
// @name           4chan black theme
// @namespace      http://userscripts.org/users/201444
// @description    Changes the theme to 4chan's boards to black except /vp/
// @include        *4chan.org*
// @exclude        http://sys.4chan.org/*/post
// ==/UserScript==

function addGlobalStyle(css) {
    var head, style;
    head = document.getElementsByTagName('head')[0];
    if (!head) { return; }
    style = document.createElement('style');
    style.type = 'text/css';
    style.innerHTML = css;
    head.appendChild(style);
}

//Main body background image & alternative colour 
addGlobalStyle(' body {color:#a1a1a1; background-image:url(data:image/png;base64,); background-repeat: repeat; } ');

//Posting blocks [backrgound is #a1a1a1] [text is #1a1a1a]
addGlobalStyle(' .reply { background-color: #a1a1a1!important; color:#1a1a1a!important; } ');

//Reply border colours
addGlobalStyle('div.reply {border-color: #1a1a1a !important;}');

//Poster name [default is anonymous]
addGlobalStyle(' .postername, .commentpostername {color:#4a4a4a !important;}');

//Header colour [/b/ /wg/] and other things
addGlobalStyle(' #header a, #navbot a, #navbotr a, .pages td a {color:#0B6E0E!important;}');

// Posting mode:reply [bar colour]
addGlobalStyle(' html body table tbody tr th {background-color:#0B6E0E!important;}');

//Visited colour links [default were blue]
//addGlobalStyle(' a, a:visited {color:#FFD100!important; text-shadow: #1a1a1a 1px 1px 2px;}');
addGlobalStyle(' a, a:visited {color: #0B6E0E !important; font-weight: bold;} ');

// a:hover attributes
addGlobalStyle(' a.quotejs:hover { text-decoration: underline;}');

// quotelink colour
addGlobalStyle('a.quoteLink, a.quotelink {color: #0B6E0E !important;');

//Logo font colour [/b/ Random]
addGlobalStyle(' .logo {color:#0B6E0E!important;}');

//Image logo border colour
addGlobalStyle('.logo img {border-bottom-color:#0B6E0E; border-top-color:#0B6E0E; border-left-color:#0B6E0E; border-right-color:#0B6E0E;}');

//Reply banner colour
addGlobalStyle('div.postingMode {background-color: #4F6B05;');

//Post block colours
addGlobalStyle('.postblock {background-color: #A1A1A1; color: #1A1A1A; border-bottom-color:#0B6E0E; border-top-color:#0B6E0E; border-left-color:#0B6E0E; border-right-color:#0B6E0E;}');

//Posting form colours
addGlobalStyle('table.postForm > tbody > tr > td:first-child { background-color: #a1a1a1; border: 1px solid #1F2B00; color: #1a1a1a;}');

//Pages bar colours
addGlobalStyle('.pages {background-color: #A1A1A1; border-bottom-color: #1A1A1A; border-right-color: #1A1A1A;}');

//Pages bar text colour
addGlobalStyle('.pages td {color:#1a1a1a;}');

//hr top bar colour
addGlobalStyle('hr {border-top-color: #A1A1A1;}');

//Post highlight colour
addGlobalStyle('.reply:target, .highlight, .reply.highlight {color:#1a1a1a !important; background-color:#f9f9f9 !important; border-color: -moz-use-text-color #1A1A1A #1A1A1A -moz-use-text-color !important;');

// >comment colour
addGlobalStyle('.quote {color: #4F6B05 !important;}');

//postNum & postInfo hover colour
addGlobalStyle('div.post div.postInfo span.postNum a:hover {color: #273500 !important;');

//removes ad black line
addGlobalStyle(' div [style="width: 300px; position: absolute; left: 5%; border: 1px solid black;"] { display:none!important;}');

//Doubledash >> colour before post blocks
addGlobalStyle('.doubledash {color: #A1A1A1;}');

//text box size
addGlobalStyle('html body div.postarea form table tbody tr td textarea.inputtext {height: 200px; width: 400px;}');

//Top board separators ( [a / b / c ]
addGlobalStyle('div#boardNavDesktop {color: #A1A1A1 !important;');

//Bottom board separators ( [a / b / c]
addGlobalStyle('div#boardNavDesktopFoot {color: #A1A1A1 !important;');

//Theme link colours [yotsuba - futaba]
addGlobalStyle('a.replylink, div#absbot a {color: #A1A1A1 !important;');

//Footer disclaimer colour
addGlobalStyle('.absBotText {color: #A1A1A1 !important;');

//page number colours
addGlobalStyle('div.pagelist {background: none repeat scroll 0 0 #A1A1A1;color: #1A1A1A;');

//div.reply border radius re-implementation
addGlobalStyle('div.reply {-moz-border-radius: 10px; border-radius: 10px;}');